import React from "react";
import { Table } from "reactstrap";
const master = () => {
  return (
    <div>
      <Table>
        <thead>
          <tr>
            <th>#</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Username</th>
          </tr>
        </thead>

        <tbody>
          {props.data.map((contents, num) => (
            <>
              <tr>
                <th scope="row">1</th>
                <td>{contents.id}</td>
                <td>{contents.gender}</td>
                <td>{contents.year}</td>
                <td>{contents.mon}</td>
                <td>{contents.day}</td>
                <td>{contents.time}</td>
                <td>{contents.subscriptionTime}</td>
              </tr>
            </>
          ))}
        </tbody>
      </Table>
    </div>
  );
};
Index.getInitialProps = async function ({ query }) {
  //const url = require("url");
  //console.log(url);
  //  console.log(query.id);
  const res = await axios.get(
    "http://localhost:8001/7ZWc6ri466Gc6rSA66as7J6Q7Y6Y7J207KeA",
    {}
  );
  const data = await res.data;

  console.log(data);

  console.log(`Show data fetched. Count: ${data.length}`);
  return {
    data: data,
  };
};
export default master;
